import React from 'react'

export const QuickBuyBottom = () => {
  return (
    <div>

      <Flex border={"1px solid red"} h="200px"  w="95%" m="auto" mt="50px">
        
           {new Array(5).fill("").map((item, i) => (
                        
                            <StarIcon  key={i}
                              color={i > elem.rating ? "blue.200" : "blue.500"}
                              
                            />
              ))}
        
      </Flex>
      <Box  border={"1px solid black"} h="120px">

      </Box>
    </div>
  )
}
